.text
        la  s2, b
        la  s4, d
        la  s5, T1
        lw  s7, alpha
        lw  s8, beta
        lw  s9, N

        # Preliminary part: ... #

		# inicializaçao de auxiliares:
		addi t6, zero, 4 #
        mul a3, s9, t6   # a3 -> 4*N
        add a1, zero, s2 # a1 -> *B

        # i=0
        add t1, zero, zero
        # for(j=0,...,...){
        add t2, zero, zero
transposta2:
		add t0, zero, a1 # t0 -> *auxB = B

		beq t1, t2, else
		lw t3, 0(a1)
		mul t4,t2,t6
		mul t5,a3,t2
		sub t4,t5,t4 #ajuste do endereco N*j*4-j*4
		add a1,a1,t4
		lw t4, 0(a1)
		sw t3, 0(a1)
		mv a1,t0
		sw t4,0(a1)
else:
		addi t2,t2,1
		addi a1,a1,4
		blt t2,s9, transposta2
		
		addi s9,s9,-1
		mv t2,x0
		addi a6,a6,4  #o primeiro elemento das matrize mais pequenas será sempre 4*4x
		add a1,a1,a6
		bne s7,s9, transposta2

        # First part: T1 = A*B #

        # Inicializa??o de auxiliares:
        addi t0, zero, 4 #
		addi s9,x0,64
        mul a3, s9, t0   # a3 -> 4*N
        add a0, zero, s1 # a0 -> *A
        add a1, zero, s2 # a1 -> *B
        add t0, zero, a1 # t0 -> *auxB = B
        add a2, zero, s5 # a2 -> *T1

        # for(i=0,...,...){
        add t1, zero, zero
f1loop1:
        # for(j=0,...,...){
        add t2, zero, zero
f1loop2:
        # for(k=0,...,...){
        add t3, zero, zero
        # aux1 = 0
        add t4, zero, zero
f1loop3:
        # ... += memory(A,R,i,k,0)*...
        lw t5, 0(a0)
        # ... += ...*memory(B,R,k,j,0)
        lw t6, 0(a1)
        # ... += memory(A,R,i,k,0)*memory(B,R,k,j,0)
        mul t5, t5, t6 
        # aux1 += memory(A,R,i,k,0)*memory(B,R,k,j,0)
        add t4, t4, t5
        # A++
        addi a0, a0, 4
        # auxB += 4 (salta uma coluna)
        addi a1, a1, 4
        # for(...,...,k++)
        addi t3, t3, 1 
        # for(...,k<size,...)
        blt t3, s9, f1loop3
        # }
 # }
        # memory(T1,W,i,j, aux1)
		# t4 = A*B
		# t4 = alfa (A * B)
	    mul t4, s7, t4
		# t5 = C
		lw t5, 0(s3)
		# t5 = beta C
		mul t5, s8, t5
		# t4 = alfa (A * B) + beta C
		add t4, t4, t5

        sw t4, 0(s4) # D[i][j] = alpha*T1[i][j] + beta*C[i][j]; 
        # D++
        addi s4, s4, 4
		# C++
        addi s3, s3, 4
        # A -= N*4 (rebobina para o inicio da linha)
        sub a0, a0, a3
        # for(...,...,j++)
        addi t2, t2, 1
        # for(...,j<size,...)
        blt t2, s9, f1loop2
        # }
        # A += N*4 (salta uma linha)
        add a0, a0, a3
        add a1, zero, s2
        # for(...,...,i++)
        addi t1, t1, 1
        # for(...,i<size,...)
        blt t1, s9, f1loop1
        # }


        # return
        li a7, 1
        ecall
